import './tabpage.scss';

import React from 'react';
import PropTypes from 'prop-types';

import addIcon from '../assets/add.svg';

import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';

const TabPageItem = (props) => {
    return(
    <TabList className="tab">
        <Tab className="position">
            <a>{props.tab_item_total}</a>
            <p>{props.tab_item_title}</p>
         </Tab>
    </TabList>
    )
}

const TabPageItems = () => {
    const rows = [
        {id: 1, tab_item_total: "77", tab_item_title: "Total alerts"},
        {id: 2, tab_item_total: "4", tab_item_title: "Continuing"},
        {id: 3, tab_item_total: "2", tab_item_title: "Corresponding"},
        {id: 4, tab_item_total: "6", tab_item_title: "Resolved"},
        {id: 5, tab_item_total: "40", tab_item_title: "Dismissed"},
        {id: 6, tab_item_total: "33", tab_item_title: "Closed"},
    ]
    return (
        <>
        {rows.map((row) => <TabPageItem key={row.id} tab_item_total={row.tab_item_total} tab_item_title={row.tab_item_title} />)}
     </>
    )
}


export const TabPage = () => {
    return (
        <Tabs>
            <TabList>
                <Tab>Tab1</Tab>
                <Tab>Tab2</Tab>
            </TabList>
            <TabPanel>
                <h2>タブ1</h2>
            </TabPanel>
            <TabPanel>
                <h2>タブ2</h2>
            </TabPanel>
        </Tabs>
    )
}

export default TabPage;
